"223608":{"id":"223608","name":"Toda Família Tem","slug":"toda-familia-tem","original_title":"Toda Família Tem","overview":"Pê é um jovem de 19 anos cuja rotina muda repentinamente quando ele precisa retornar com a família para a casa da avó no Rio de Janeiro, onde sua vida privilegiada cheia de liberdade e conforto chega ao fim. Ao mesmo tempo em que ele se adapta para conviver com toda a sua família debaixo do mesmo teto e todas as cômicas confusões da Família Silva, Pê também precisa lidar com seus próprios dilemas e inquietações típicos de um jovem mimado que busca se encontrar no mundo.","first_air_date":"2024-07-11","episode_run_time":0,"vote_average":7.5,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Jonathan Haagensen","Pedro Ottoni","Mariana Veil"],"production_companies":["Black Pen Filmes","Amazon Studios"],"genres":["Comédia"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/5imOAdOhhE53efUTdwqk2dJ31sN.jpg","poster_path":"https://image.tmdb.org/t/p/original/noT0S2Iml4xScz2am3V7HY7vhda.jpg","cast":["Pedro Ottoni","Maíra Azevedo","Solange Couto","Érico Brás","Gabriela Dias"],"trailer":"5OCBriBWIPg","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/bzWpem7Czfqpwa8UiNSceJuqs0a.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/bzWpem7Czfqpwa8UiNSceJuqs0a.jpg","air_date":"2024-07-11","episode_count":7,"overview":"N/A","vote_average":6.4,"episodes":{"1":{"name":"Visitas","overview":"Bota água no feijão, porque a casa da vó Geni vai ficar cheia! Pê organiza uma festinha em casa para rever seus antigos amigos enquanto tenta lidar melhor com a mudança para o Rio de Janeiro. Paty está disposta a revelar o namorado para a família e decide organizar um jantar romântico em casa no mesmo horário da festa de Pê. Jorge arranja uma série de bicos pelo bairro para ajudar a pagar o gás.","air_date":"2024-07-11","runtime":29,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7},"2":{"name":"Sonhos","overview":"Pê não sabe o que quer ser quando \"crescer\" e a pressão para decidir sobre seu futuro profissional faz ele buscar ajuda nos lugares mais inusitados. Deise decide retomar a carreira de advogada, mas para isso precisa estudar para a prova da OAB, apesar da casa barulhenta por conta da rixa entre Geni e Jorge. Pietra recolhe animais da rua e os esconde em casa, com a ajuda de Marcelinho.","air_date":"2024-07-11","runtime":26,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":5},"3":{"name":"Ciúmes","overview":"Pê surpreende a família e aceita um convite inusitado do seu pai biológico. Pietra e Marcelinho querem fazer o melhor Dia dos Pais para Jorge e Paulo Henrique, e tentam chegar em consenso para trabalharem em equipe. Deise evita conversar sobre o falecido pai com Geni, enquanto essa se sente ignorada pela família porque é \"todo mundo só pensa nos pais dessa casa\".","air_date":"2024-07-11","runtime":25,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":6},"4":{"name":"Romance","overview":"Pê acredita que a amizade de Bruna pode ser algo mais e começa a investir num possível romance. Paty e Bruna armam contra Pê. Deise e Jorge saem para relaxar na praia antes da prova da OAB, enquanto vó Geni se prepara para o encontro com o admirador secreto.","air_date":"2024-07-11","runtime":26,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7},"5":{"name":"Surpresas","overview":"Trégua! Pê descobre o segredo de Paty e faz de tudo para agradar a irmã. Pietra acha que a movimentação da casa é para sua festa de aniversário e tenta sabotar qualquer possibilidade de surpresa. A Família Silva pressiona Júnior para descobrir as intenções dele com Paty, agora que teremos um novo elemento na casa.","air_date":"2024-07-11","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":6},"6":{"name":"Heróis","overview":"Pê precisa atravessar a cidade para chegar a tempo na prova do vestibular e contará com a ajuda da família para completar essa maratona. Jorge participa de uma entrevista de emprego inusitada. Pietra e Marcelinho ficam em casa aos cuidados de Chicão, que arranja um jeito de distrair as crianças.","air_date":"2024-07-11","runtime":31,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7},"7":{"name":"Segredos","overview":"Pê se prepara para receber o resultado do vestibular enquanto a família Silva se reúne num churrasco de despedida. Geni esconde de todos que um grupo empresarial quer comprar sua casa. Jorge esconde da família que recebeu uma proposta de trabalho em outro país.","air_date":"2024-07-11","runtime":27,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":7}}}}},
