"126035":{"id":"126035","name":"Apesar de Tudo, Amor","slug":"apesar-de-tudo-amor","original_title":"알고있지만,","overview":"Park Jae Uhn acha que namorar é uma perda de tempo, mas gosta de flertar. Mesmo sendo amigável e alegre com todos, ele não persegue os outros. Ele é um mestre do \"empurra-e-puxa\": quem não se deixa levar pelas emoções. Jae Uhn estabelece limites firmes entre ele e as outras pessoas e não revela como se sente. No entanto, quando conhece Yoo Na Bi, ele quer cruzar essas linhas. Yoo Na Bi quer namorar, mas não acrredita no amor. Depois de uma experiência amarga com seu primeiro amor, ela não acredita mais no destino. Mas quando ela conhece Park Jae Uhn, ele tem um efeito mágico sobre ela que desafia a decisão de Na Bi de permanecer indiferente.","first_air_date":"2021-06-19","episode_run_time":69,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":10,"created_by":["김가람"],"production_companies":["Beyond J","Studio N","SLL"],"genres":["Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/cPLtnxTlFpCIyH6AkGNuGCluvY1.jpg","poster_path":"https://image.tmdb.org/t/p/original/voEk1bRV5WaFMGDaTZl3x6T5hkJ.jpg","cast":["한소희","Song Kang","Chae Jong Hyeop","이열음","양혜지"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/j7DMxGYi8dx9EOmnmSI2yeUhiOZ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/j7DMxGYi8dx9EOmnmSI2yeUhiOZ.jpg","air_date":"2021-06-19","episode_count":10,"overview":"Park Jae Uhn acha que namorar é uma perda de tempo, mas gosta de flertar. Mesmo sendo amigável e alegre com todos, ele não persegue os outros. Ele é um mestre do \"empurra-e-puxa\": quem não se deixa levar pelas emoções. Jae Uhn estabelece limites firmes entre ele e as outras pessoas e não revela como se sente. No entanto, quando conhece Yoo Na Bi, ele quer cruzar essas linhas. Yoo Na Bi quer namorar, mas não acrredita no amor. Depois de uma experiência amarga com seu primeiro amor, ela não acredita mais no destino. Mas quando ela conhece Park Jae Uhn, ele tem um efeito mágico sobre ela que desafia a decisão de Na Bi de permanecer indiferente.","vote_average":7.9,"episodes":{"1":{"name":"Destino não existe. Apesar disso...","overview":"Yu Na-bi revê o homem charmoso que fez seu coração balançar dias atrás. Desta vez, ela é formalmente apresentada a Park Jae-eon.","air_date":"2021-06-19","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/jYBxTpP3BM7fe57AS0nYudKyBSj.jpg","vote_average":9.8},"2":{"name":"Não sou a única. Apesar disso...","overview":"Na-bi se pergunta se Jae-eon também trata as outras garotas de forma tão carinhosa e tem um sonho picante com ele.","air_date":"2021-06-26","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/rJtqI4b1TPPItfUXQj1E4lP6Wst.jpg","vote_average":10},"3":{"name":"Já começou. Apesar disso...","overview":"Uma gripe, uma crise de ciúmes e uma pequena confusão acabam distanciando Na-bi e Jae-eon. Mas, depois, eles ficam mais próximos do que nunca.","air_date":"2021-07-03","runtime":76,"still_path":"https://image.tmdb.org/t/p/original/6VlQBeCha4cCGwFICCTk0zdtteG.jpg","vote_average":0},"4":{"name":"Sei que não é amor. Apesar disso...","overview":"Na-bi está tão atraída por Jae-eon que não se preocupa com os problemas do relacionamento por um tempo — até ter um choque de realidade.","air_date":"2021-07-10","runtime":76,"still_path":"https://image.tmdb.org/t/p/original/cSy6suoiWuO9QVKCse9LKTgFtEH.jpg","vote_average":0},"5":{"name":"Sei que nada vai mudar. Apesar disso...","overview":"Cansada das atitudes de Jae-eon, Na-bi termina com ele. Oh Bit-na bebe demais e faz uma confissão. Yun Seol-a procura Na-bi no campus.","air_date":"2021-07-17","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/4HGTwRks00LZ3a5fT37wnzqlVbc.jpg","vote_average":0},"6":{"name":"O amor não existe. Apesar disso...","overview":"Na-bi visita sua cidade natal, onde ajuda a tia no ateliê de cerâmica e curte a natureza com Yang Do-hyeok. Jae-eon sente falta de Na-bi.","air_date":"2021-07-24","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/jsGc68VTOMfId8jG3cVm3atQfNU.jpg","vote_average":4},"7":{"name":"Sei que não tem volta. Apesar disso...","overview":"Os alunos chegam à pousada para um retiro em grupo. Na-bi tenta manter distância de Jae-eon, que fica de olho nela e em Do-hyeok.","air_date":"2021-07-31","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/8mn94PtISrawo1xfrR6WTGVFFuH.jpg","vote_average":0},"8":{"name":"Sei que é mentira. Apesar disso...","overview":"Do-hyeok faz uma declaração fofa. Na-bi visita uma galeria com Jae-eon. Yun Sol revela seus sentimentos por Seo Ji-wan.","air_date":"2021-08-07","runtime":66,"still_path":"https://image.tmdb.org/t/p/original/rnBCEr8lzViW3iQLzeaeJFze665.jpg","vote_average":0},"9":{"name":"Sei que acabou. Apesar disso...","overview":"Com medo de perder Na-bi, Do-hyeok aparece na frente do prédio dela, mas ela está com Jae-eon. Sol tranquiliza Ji-wan.","air_date":"2021-08-14","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/km2bs0NpdxhPCOBrvMGXgDLzc3c.jpg","vote_average":0},"10":{"name":"Apesar disso, eu ainda...","overview":"Na-bi se esforça para recriar a escultura poucos dias antes da exposição. Mantendo sua palavra, Jae-eon se despede de suas borboletas.","air_date":"2021-08-21","runtime":70,"still_path":"https://image.tmdb.org/t/p/original/guTR5bxcz9StwNv1LxuEWdNJOub.jpg","vote_average":0}}}}},
