"207311":{"id":"207311","name":"Você Faria o Mesmo","slug":"voce-faria-o-mesmo","original_title":"Tú también lo harías","overview":"Um ônibus é sequestrado por três ladrões—que acabam mortos antes de conseguirem fugir. A história de cada passageiro é a mesma: um homem encapuzado salvou o dia. Conforme o caso se desenrola, a linha entre herói e criminoso começa a se confundir.","first_air_date":"2023-04-26","episode_run_time":0,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":["David Victori","Jordi Vallejo"],"production_companies":["Espotlight","Legendary Global España Holdings"],"genres":["Crime","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/eA5xrWst6GENp558n6ukQUjCXjr.jpg","poster_path":"https://image.tmdb.org/t/p/original/s2RPQ1rBmpoNQxFcPml4wZFhwif.jpg","cast":["Pablo Molinero","Ana Polvorosa","Michelle Jenner","José Manuel Poga","Paco Tous"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vWLheQr73pPm4Y69o2xpKq3pvUY.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vWLheQr73pPm4Y69o2xpKq3pvUY.jpg","air_date":"2023-04-26","episode_count":8,"overview":"N/A","vote_average":8.2,"episodes":{"1":{"name":"Três mortos num ônibus","overview":"Um homem misterioso foge após derrubar três criminosos que roubavam o ônibus em que ele estava. A polícia interroga os passageiros, que alegam não saber de nada.","air_date":"2023-04-26","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/p3GgwaGELnuXLZC0uSQaRNr2RBr.jpg","vote_average":8.3},"2":{"name":"Pacto de silêncio","overview":"Os detetives Garza e Quirós suspeitam que os passageiros estejam ocultando a verdade. Enquanto isso, as mídias sociais celebram o homem encapuzado como um herói.","air_date":"2023-04-26","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/wRNoTb7yiIbtm7uX4WxxzN8NFel.jpg","vote_average":8},"3":{"name":"A justiça","overview":"Garza e Quirós finalmente conseguem uma pista quando uma tenaz repórter de televisão começa a investigar o vigilante do ônibus apelidado de \"O justiceiro\".","air_date":"2023-04-26","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/yWpZDDYWRchdAnhNfzb8lXZfWB0.jpg","vote_average":8},"4":{"name":"Cara a cara","overview":"A polícia está pronta para prender o homem que eles acreditam ser o justiceiro, até que uma nova testemunha aparece com informações chocantes.","air_date":"2023-04-26","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/xWCVCyP476RL1og2z3TeQbwp8cL.jpg","vote_average":8.3},"5":{"name":"Teatro","overview":"O relato de Matías sobre os acontecimentos leva Garza a medidas drásticas em busca da verdade.","air_date":"2023-04-26","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/rJUYFS06mxSnFncUwbN66kYL7XJ.jpg","vote_average":8.333},"6":{"name":"Uma decisão difícil","overview":"Elisa cede sob pressão e o que ela diz a Garza e Quirós muda tudo—mas não é suficiente para forçar a mão da Chefe Jordan.","air_date":"2023-04-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/iYClFnkgT5drRfJbo37uF9tqv8M.jpg","vote_average":8},"7":{"name":"Livre novamente","overview":"As semanas se passam e o frenesi da mídia em torno do caso finalmente diminui. Garza recebe a visita inesperada de dois passageiros.","air_date":"2023-04-26","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/vcUKVwkVGDUP0iwvqZL1LH5NYia.jpg","vote_average":8.3},"8":{"name":"A verdade","overview":"Armado com a verdade, Garza resolve o problema com as próprias mãos.","air_date":"2023-04-26","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/fyOk0VWTFG9d38e31lxMojcH3xC.jpg","vote_average":8}}}}},
