"126914":{"id":"126914","name":"Com Amor","slug":"com-amor","original_title":"With Love","overview":"A série acompanha os irmãos Diaz, Jorge e Lily, e suas jornadas no amor. Enquanto Jorge vive um romance com Henry, Lily acabou de terminar um relacionamento de anos, pouco antes do Natal.","first_air_date":"2021-12-16","episode_run_time":0,"vote_average":6.5,"number_of_seasons":2,"number_of_episodes":11,"created_by":["Gloria Calderón Kellett"],"production_companies":["Amazon Studios","GloNation Studios"],"genres":["Comédia","Drama"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/tlamrEuFPeXBjUNW4ynmJaAemV3.jpg","poster_path":"https://image.tmdb.org/t/p/original/m8IVBg7zsxlJvhhK3ewDstfuVb7.jpg","cast":["Emeraude Toubia","Mark Indelicato","Isis King","Vincent Rodriguez III","Rome Flynn"],"trailer":"tumodJV67JM","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/kx8NEbEwbuai03eWvFztbgXbM8Q.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/kx8NEbEwbuai03eWvFztbgXbM8Q.jpg","air_date":"2021-12-16","episode_count":5,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Nochebuena","overview":"É véspera de Natal, também chamada de \"Nochebuena\", e a família Díaz se reúne para a sua celebração anual. A Lily tem que encarar o recente término do seu relacionamento, enquanto o irmão dela, Jorge Jr., vai apresentar o novo namorado à família.","air_date":"2021-12-16","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/dWKnXjofFmLKy1CveIuvErb6h1V.jpg","vote_average":0},"2":{"name":"Véspera de Ano-Novo","overview":"A turma comparece a duas festas de Réveillon: uma delas mais cedo, na casa da família, onde participa de todas as divertidas tradições latinas de Ano Novo, e outra mais chique, onde o romance está no ar para todos. Enquanto isso, Sol e Miles têm um primeiro encontro inesperado.","air_date":"2021-12-16","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/hNhXG96rjTQcVy2G0qGMh4AHruU.jpg","vote_average":0},"3":{"name":"Dia dos Namorados","overview":"É o Dia dos Namorados, e a Lily, dona da sua nova vida de solteira, vai a uma vinícola sozinha. Entretanto, o seu dia de autocuidado é interrompido quando ela encontra alguns rostos familiares. Em Portland, as coisas se complicam para Beatriz, enquanto Miles e Sol enfrentam o primeiro obstáculo no relacionamento.","air_date":"2021-12-16","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/6zhtHatdX4QR3oLgGDmmAprKc4d.jpg","vote_average":0},"4":{"name":"Dia da Independência","overview":"É o Dia da Independência, e os relacionamentos progrediram desde o Dia dos Namorados – alguns de forma positiva, e outros de forma negativa –, à medida que cada casal tem dificuldade com os diferentes significados de \"Independência\".","air_date":"2021-12-16","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/mqYEAvlpvI6cvx0GwJSdqdZMoB9.jpg","vote_average":0},"5":{"name":"Día de Los Muertos","overview":"É o \"Día de Los Muertos\", e os membros da família Díaz são forçados a confrontar alguns \"fantasmas\" de seus respectivos passados.","air_date":"2021-12-16","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/6hLtR2czUdyuvUoSbcFgGuX2Sri.jpg","vote_average":0}}},"2":{"name":"Temporada 2","poster_path":"https://image.tmdb.org/t/p/original/m8IVBg7zsxlJvhhK3ewDstfuVb7.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/m8IVBg7zsxlJvhhK3ewDstfuVb7.jpg","air_date":"2023-06-01","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Noite de Natal","overview":"Os nossos casais felizes se preparam para desfrutar da noite de Natal enquanto a grande dúvida paira no ar: qual dos netinhos de Marta vai se casar?","air_date":"2023-06-01","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/7KrhIXluV97kdOGaXim1DKKDx7F.jpg","vote_average":0},"2":{"name":"Festa de Noivado","overview":"Nada une as famílias como uma festa de noivado! Mas enquanto o clã Díaz luta contra o perfeccionismo e notícias preocupantes, eles descobrem que os melhores planos de ratos e homens muitas vezes dão errado.","air_date":"2023-06-01","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/uhiGKMaAelTOiuuybmVLJ2amTke.jpg","vote_average":0},"3":{"name":"Festa de Duas Vezes Quinze da Lily","overview":"É 11 de junho - ou seja, aniversário de 30 anos da Lily! E não há jeito melhor de comemorar a ocasião do que enfrentar uma velha lista de desejos dela... com a ajuda de um surpreendente parceiro de crime.","air_date":"2023-06-01","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/o3gMdwzF6jpWTYWXQSTKowKxd5Y.jpg","vote_average":0},"4":{"name":"Despedida de Solteiro","overview":"Viva Las Vegas! Chegou o fim de semana do Dia do Trabalho e todo mundo está se soltando para a despedida de solteiro - talvez se soltando até demais, já que a \"Cidade do Pecado\" em excesso coloca os relacionamentos à prova.","air_date":"2023-06-01","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/8uyALFKTJt9nJKONmOHlvrgCIZV.jpg","vote_average":0},"5":{"name":"Ação de Graças","overview":"É Dia de Ação de Graças na casa dos Díaz, e família e amigos se reúnem para agradecer por um ano maravilhoso... até que um convidado inesperado aparece no jantar e complica as coisas.","air_date":"2023-06-01","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/5vausmTohPx2JH5fXu1cQrsXGey.jpg","vote_average":0},"6":{"name":"O Casamento","overview":"Dá pra ouvir os sinos de casamento tocando? O dia do casamento finalmente chegou e todos estão dando seu máximo para o \"felizes para sempre\"... mas será que eles estão fazendo a escolha certa?","air_date":"2023-06-01","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/nBtKuIDQxf2qivWLxvUux169lxZ.jpg","vote_average":0}}}}},
